import React from 'react'
import csclublogo from '../csclub_logo.png';

function Header (props){

    const tags = props.tags;
    activeTag = props.activeTag;
    let tagsArray = [];

    tags.forEach(element => {
        if (element === activeTag){
            tagsArray.push(<Tag setActiveTag={props.setActiveTag}
                                activeTag={props.activeTag}
                                special={true}/>);
        }
        else {
            tagsArray.push(<Tag setActiveTag={props.setActiveTag}
                activeTag={props.activeTag}
                special={false}/>);
        }

    });


    return (
       <header>
           <div class="flex justify-start px-6 py-6">
            <img src={csclublogo} alt="Logo" width="85px" height="85px"/>
            <button className="text-gray-500 py-2 px-4 text-s font-bold">About</button>
           </div>
       </header> 
    )
}

export default Header
